      | 364561 -> { ItemTypeData.id= 364561; name= "'Templar' Scrambler Rifle"; published= false; description= "The scrambler rifle is a selective-fire weapon capable of semi-automatic and charged fire. Each shot produces a pulse of sinuous energy capable of penetrating shield and metal. By keeping pressure on the trigger, the operator can control the power of each discharge, scaling it to produce an intense pulse of energy fatal to soft targets.    The added power output does come with downsides, most notably increased heat build-up; left unmanaged, thermal stresses age the focusing crystal prematurely, resulting in splintering and potentially lethal feedback. Despite this and several other issues – increased heft, poor reliability, and high manufacturing cost – the scrambler rifle is widely available and in service on battlefields clusterwide."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
