      | 365434 -> { ItemTypeData.id= 365434; name= "Passive Omega-Booster (60-Day)"; published= false; description= "Boosters are biomechanical grafts designed to stimulate nerve growth and neurotransmitter activity, temporarily increasing cognitive processes. The graft will degrade over time until it is completely absorbed by the body and ceases to function.    Passive Boosters increase the rate of passive skill point accrual while they are active. Omega-Boosters feature superior performance over standard models.    NOTE: Passive boosters will continue to function on non-primary clones as a factor of the base skillpoint accrual rate. (Non-primary clones without a passive skill booster do not accrue skill points at all.)  "; marketGroupId= None; groupId= 354641; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 365628 -> { ItemTypeData.id= 365628; name= "'Construct' Viziam Scrambler Pistol"; published= false; description= "The Scrambler is a semi-automatic pistol originally designed and manufactured by Carthum Conglomerate. A small-scale directed energy weapon, it produces a laser-induced plasma channel capable of dealing short-range pin-point damage to a target.    Power consumption is excessive, but is addressed via a rear-loaded fuel cell, allowing cells to be exchanged quickly and easily once exhausted. Moreover, advances in the polymers used in the weapon's construction have greatly reduced heat build-up and improved heat dissipation, resulting in improved reliability over earlier modules. "; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
