      | 368635 -> { ItemTypeData.id= 368635; name= "Federation Sentinel G/1-Series"; published= false; description= "The Sentinel dropsuit is a second-generation solution designed to withstand concentrated small arms fire and protect the wearer from the concussive, thermal, and impact forces of low-grade explosives. Additionally, its power-assisted exoskeleton facilitates usage of the heaviest caliber personal weapons.    Enhanced to withstand kinetic and fragmentary impacts with minimal deformation, Gallente Sentinel technology offers the best armor protection currently available in the cluster. Ablative surfacing helps deflect incoming fire and ultra-efficient armor composites and electrically charged active protection plates increase survivability in even the most dangerous combat situations.    Heavy dropsuits lack the mobility of lighter suits, but this trade-off results in a defensive system that defies standard infantry conventions. No other classification of personal armor can claim to be able to stand toe-to-toe with enemy vehicles and survive."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
